import React from 'react';
import './Card.css';
export default function Card(props){
    return(
        <>
          <div className="p-c">
              <div className="p-c-img">
                 <img src={props.image} alt="" />
              </div>
              <div className="p-c-title">
                  {props.title}
              </div>
              <div className="p-c-des">
                This is a Typing Test game where you can get
                your typing speed and accuracy .
              </div>
          </div>
        </>
    )
}
